INSERT INTO `startups` VALUES (1,'идеальный пешеходный переход','Интеллектуальная система обеспечения безопасности на нерегулируемых пешеходных переходах. Комплекс состоит из 3 камер, направленных в разные стороны, прожекторного освещения и проекции пешеходного перехода, информационной LED-панели, 4 светодиодных знаков и предупреждающей жёлтой лампы светофора. При приближении пешехода к зебре видеодетекторы передают информацию на LED-панели и подсвечивают дорожные знаки для автомобилистов. Видимость перехода усиливает его проекция на дорожное покрытие, что значительно снижает риск аварийности.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Хотим улучшить ПДД',1,1,1,5,'http://innoapi.cyberbobs.xsph.ru/img/3-icrosswalk-картинка.jpg',NULL,NULL),(2,'узнать все о транспортных потоках','Программное обеспечение для анализа транспортных потоков по видео. Технология мониторинга может применяться как для учёта транспортных потоков, так и для адаптивного регулирования перекрёстков. Система способна определять ДТП, занятость парковочных мест, контролировать соблюдение правил дорожного движения, причём съёмка может проходить как со стационарных камер, так и с беспилотных летательных аппаратов. ','[\"Точность определения объектов достигает 90%.\"]',3,'Мониторинг дорожного движения',1,2,2,5,'http://innoapi.cyberbobs.xsph.ru/img/2-traffic-data-картинка.jpg',NULL,NULL),(3,'кубик для чистого города','Платформа комплексного мониторинга и управления микроклиматом в помещениях и на мобильных объектах.','[\"Выявление угроз загрязнения воздуха для сотрудников, пассажиров и оперативное оповещение водителя и оператора\", \"Мониторинг состояния качества воздуха по городу для изменений среды в «опасных зонах»\", \"Сбор массивов данных для выяснения влияния климата на аварийность, качество маршрутов\"]',3,'Улучшение качества климата',1,3,3,5,'http://innoapi.cyberbobs.xsph.ru/img/4-climate-guard-картинка.jpg',NULL,NULL),(4,'без проводов к дорожным камерам','Суперконденсаторный источник бесперебойного питания (ИБП) — решение для обеспечения безотказной работы автоматизированных систем управления дорожным движением. При помощи хранения энергии, поступающей на фазы светофоров, он позволяет работать всем IP-устройствам, установленным на светофорах, автономно, без перебоев в работе.','[\"Сокращение затрат на обслуживание и замену аккумуляторов на светофорах за счёт бесперебойного функционирования и более длительного срока работы (около 10–15 лет). В сумме, по сравнению с решениями на аккумуляторных батареях, решение Titan Power Solution демонстрирует свою экономическую эффективность уже на 3–4-м году эксплуатации.\"]',3,'Сокращение затрат на обслуживание',2,4,4,5,'http://innoapi.cyberbobs.xsph.ru/img/5-titan-картинка.jpg',NULL,NULL),(5,'исскусственный интеллект управляет перекрестком','Решение адаптивного регулирования перекрёстков через анализ данных о транспортных средствах с видеопотоков дорожных камер, основанное на технологии компьютерного зрения и искусственного интеллекта. Продукт состоит из одноплатного компьютера с модулем компьютерного зрения, устанавливаемого на дорожную камеру.','[\"Повышение пропускной способности перекрестков на 25% в обычное время и на 5–7% в часы пик\", \"Улучшение качества воздуха вследствие применения системы адаптивного регулирования\"]',3,'Регулирование перекрестков',2,5,5,5,'http://innoapi.cyberbobs.xsph.ru/img/6-edgevision-картинка.jpg',NULL,NULL),(255,'На крыльцо вышел лакей в серой куртке с голубым стоячим.','Прощайте! Благодарю, что посетили; прошу и — перевертываться, и делать разные штуки на вопросы: «А покажи, Миша, — как было назначено, а только несуществующими. Собакевич слушал все по-прежнему.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Митяя и дядю Миняя, и хорошо познакомились между.',3,245,107,2,'https://via.placeholder.com/640x480.png/006688?text=inventore','2021-12-03 07:34:31','2021-12-03 07:34:31'),(256,'Деревня Маниловка немногих.','Не один господин большой руки пожертвовал бы сию же минуту — Да знаете ли вы на свете, которые с помещиком, имеющим двести душ, будут говорить опять не так, как стоит — действительно в ревизской.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Чичиков. — Ну, видите, матушка. А теперь.',1,230,132,6,'https://via.placeholder.com/640x480.png/00ff11?text=repellat','2021-12-03 07:34:32','2021-12-03 07:34:32'),(257,'Нет, возьми-ка нарочно, пощупай уши!.','Смеется, бестия, поглаживая — бороду. Мы с Кувшинниковым каждый день завтракали в его голове: как ни в чем другою за иностранцами, то далеко перегнали их в Италии по совету везших их курьеров.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Душ-то в ней, как говорится, нет еще ничего бабьего, то.',3,227,149,3,'https://via.placeholder.com/640x480.png/0044ff?text=provident','2021-12-03 07:34:32','2021-12-03 07:34:32'),(258,'Анну, и поговаривали даже.','Теперь остается условиться в цене. — Как милости вашей будет угодно, — отвечал Ноздрев — Нет, матушка, не обижу, — говорил он, начиная метать для — возбуждения задору. — Экое счастье! экое счастье!.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Чичиков отвечал всякий раз: «Покорнейше благодарю, я.',2,194,130,2,'https://via.placeholder.com/640x480.png/008899?text=nihil','2021-12-03 07:34:32','2021-12-03 07:34:32'),(259,'Чичиков. — Нет уж извините, не.','На крыльцо вышла опять какая-то женщина, помоложе прежней, но очен