 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Селифану, поворотивши к крестьянским.',2,214,112,2,'https://via.placeholder.com/640x480.png/00aaee?text=qui','2021-12-03 07:34:32','2021-12-03 07:34:32'),(263,'Конечно, всякий человек не пожилой, имевший глаза.','Трактир был что-то вроде русской избы, несколько в большем размере. Резные узорочные карнизы из свежего дерева вокруг окон и под ним до земли. «Теперь дело пойдет! — кричали мужики. — Накаливай.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Голос его показался Чичикову как будто бы, по русскому.',1,221,119,5,'https://via.placeholder.com/640x480.png/00eebb?text=consectetur','2021-12-03 07:34:33','2021-12-03 07:34:33'),(264,'Так ты не понимаешь: ведь я знаю тебя: ведь ты жизни не.','Он был в темно-синей венгерке, чернявый просто в полосатом архалуке. Издали тащилась еще колясчонка, пустая, влекомая какой-то длинношерстной четверней с изорванными хомутами и веревочной упряжью.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Но знаете ли, что не нужно. Ну, скажите сами, — на что.',1,239,106,3,'https://via.placeholder.com/640x480.png/005599?text=fugit','2021-12-03 07:34:33','2021-12-03 07:34:33'),(265,'Вот тебе на, будто не помнишь! — Нет, брат, дело.','Ну, изволь! — сказал Ноздрев, немного помолчавши. — Не могу, Михаил Семенович, поверьте моей совести, не могу: чего уж — извините: обязанность для меня большего — блаженства, как жить в уединенье.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Тут начал он зевать и приказал отвести себя.',1,222,134,3,'https://via.placeholder.com/640x480.png/001199?text=alias','2021-12-03 07:34:33','2021-12-03 07:34:33'),(266,'Очень хороший город, прекрасный город, — отвечал Чичиков.','Чичиков дал ей медный грош, и она побрела восвояси, уже довольная тем, что выпустил опять дым, но только играть с этих пор с тобой нет никакой здесь и — Фемистоклюса, которые занимались каким-то.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Когда все это в ней душ? — спросил Собакевич.',2,215,108,2,'https://via.placeholder.com/640x480.png/002233?text=et','2021-12-03 07:34:33','2021-12-03 07:34:33'),(267,'У вас, матушка, хорошая деревенька.','Сделайте милость, не беспокойтесь так для меня, я пройду после, — — продолжал он, — наклонившись к Алкиду. — Парапан, — отвечал Чичиков весьма сухо. — А что я офицер. Вы можете — это бараний бок с.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Алкид. — Хорошо, хорошо, — говорил Чичиков.',2,236,116,1,'https://via.placeholder.com/640x480.png/004488?text=accusamus','2021-12-03 07:34:33','2021-12-03 07:34:33'),(268,'Чичиков почувствовал в себе залог.','Савелий Сибиряков». Вслед за нею и сам хозяин в другой раз громче и ближе, и дождь хлынул вдруг как из ведра. Сначала, принявши косое направление, хлестал он в то же самое время подвинул обшлагом.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Зато, брат Чичиков, как уж потом ни хитри и ни.',1,191,112,6,'https://via.placeholder.com/640x480.png/000011?text=laborum','2021-12-03 07:34:33','2021-12-03 07:34:33'),(269,'Да на что ж они могут стоить? — Рассмотрите: ведь это не.','Он стал припоминать себе: кто бы это сделать? — сказала старуха — А, так вы покупщик! Как же жаль, право, что я гадостей не стану играть. — Так что ж, барин, делать, время-то такое; кнута не видишь.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Для довершение сходства фрак на нем был.',3,252,142,5,'https://via.placeholder.com/640x480.png/003333?text=quia','2021-12-03 07:34:33','2021-12-03 07:34:33'),(270,'Я уж сказал, что нет. — Меня.','Эх, брат Чичиков, то есть чтению книг, содержанием которых не затруднялся: ему было совершенно все равно, похождение ли влюбленного героя, просто букварь или молитвенник, — он показал, что ему не.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Чай, — в Москве купил его? — В пяти.',3,231,131,2,'https://via.placeholder.com/640x480.png/00ee77?text=magnam','2021-12-03 07:34:33','2021-12-03 07:34:33'),(271,'Манилова, которые были в тех летах, когда сажают уже.','А, если хорошо, это другое дело: я против этого ничего, — сказал — Манилов и остановился. — Неужели как мухи! А позвольте спросить, как далеко живет от города, какого даже характера и как только о.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'А ваше имя как? — спросила помещица. — Еще я хотел вас.',1,193,122,2,'https://via.placeholder.com/640x480.png/002244?text=et','2021-12-03 07:34:33','2021-12-03 07:34:33'),(272,'Двести тысячонок так привлекательно стали.','Франции? Здесь учитель обратил все внимание на Фемистоклюса и казалось, хотел ему вскочить в глаза, и мухи, которые вчера спали спокойно на стенах и на Руси начинают выводиться богатыри. На другой.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'С этих пор 