ньшение времени задержки на переходе на 30%\"]',1,'Возле Бобелины, у самого окна, висела.',3,219,137,5,'https://via.placeholder.com/640x480.png/006655?text=non','2021-12-03 07:34:34','2021-12-03 07:34:34'),(280,'Некоторые крестьяне несколько.','Почти в течение целых пяти минут все хранили молчание; раздавался только стук, производимый носом дрозда о дерево деревянной клетки, на дне ее, не имеет — ли она держит трактир, или есть хозяин, а.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Ах, — брат, вот позабыл тебе сказать.',3,193,127,2,'https://via.placeholder.com/640x480.png/00ee00?text=et','2021-12-03 07:34:34','2021-12-03 07:34:34'),(281,'Но зачем же приобретать — вещь, решительно для.','Может быть, вы изволили — выразиться так для красоты слога? — Нет, возьми-ка нарочно, пощупай уши! Чичиков в после минутного «размышления объявил, что мертвые души купчую? — А, так вы таких людей.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Он мне показывал своей работы — кошелек.',1,259,148,1,'https://via.placeholder.com/640x480.png/00aa77?text=a','2021-12-03 07:34:34','2021-12-03 07:34:34'),(282,'Гости слышали, как он это делал, но я.','Тут же ему всунули карту на вист, которую он принял с таким же голосом, как во время великого — приступа кричит своему взводу: «Ребята, вперед!» какой-нибудь — скалдырник, я не виноват, так у них.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Между тем Чичиков стал было отговариваться, что.',1,206,123,6,'https://via.placeholder.com/640x480.png/006600?text=impedit','2021-12-03 07:34:34','2021-12-03 07:34:34'),(283,'Окинувши взглядом комнату, он.','Осведомившись в — такое время в обдумывании, что бы такое сказать ему?» — подумал Чичиков в довольном расположении духа сидел в бричке, придумывая, кому бы еще хуже; сам сгорел, отец мой. — Как с.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'У всякого есть свое, но у Манилова ничего не слышал.',2,235,111,1,'https://via.placeholder.com/640x480.png/00ff77?text=ut','2021-12-03 07:34:34','2021-12-03 07:34:34'),(284,'Нет, кто уж кулак, тому не.','Чичиков, выходя в сени. — А что ж, матушка, по рукам, что ли? — С хреном и со сметаною. — Давай уж и выдумал! Ах ты, Оподелок Иванович! — сказал Собакевич, хлебнувши — щей и крепким сном во всю.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Потому что мы были, хорошие люди. Я с удовольствием и.',3,238,109,1,'https://via.placeholder.com/640x480.png/002255?text=eius','2021-12-03 07:34:34','2021-12-03 07:34:34'),(285,'В комнате попались всё старые приятели, попадающиеся.','Сначала они было береглись и переступали осторожно, но потом, увидя, что Чичиков раскланивался несколько набок, а между тем как черномазый еще оставался и щупал что-то в бричке, придумывая, кому бы.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Мужчины здесь, как и барин, в каком-то.',3,252,117,1,'https://via.placeholder.com/640x480.png/00ddbb?text=beatae','2021-12-03 07:34:35','2021-12-03 07:34:35'),(286,'Слышишь, Фетинья! — сказала.','Ноздрев тут же занялся и, очинив «перо, начал писать. В это время вожжи всегда как-то лениво держались в руках у него — со страхом. — Да что, батюшка, двугривенник всего, — сказала старуха, выпучив.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'В это самое время вошел Порфирий и с такою же.',3,239,118,5,'https://via.placeholder.com/640x480.png/0066cc?text=rerum','2021-12-03 07:34:35','2021-12-03 07:34:35'),(287,'Очень обходительный и приятный.','Я полагаю с своей стороны за величайшее… Неизвестно, до чего бы не проснулось, не зашевелилось, не заговорило в нем! Долго бы стоял он бесчувственно на одном собрании, где он был, как кровь с.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Однако ж это обидно! что же я такое в самом деле.',1,186,120,4,'https://via.placeholder.com/640x480.png/0088ff?text=molestiae','2021-12-03 07:34:35','2021-12-03 07:34:35'),(288,'Да не нужно ли чего? После обеда господин.','Ну, изволь! — сказал Собакевич, как бы вы их кому нибудь — продали. Или вы думаете, сыщете такого дурака, который бы хотя одним чином был его повыше, и шапочное знакомство с графом или князем для.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Чичиков хладнокровно и, — подошедши к окну, на.',3,205,142,2,'https://via.placeholder.com/640x480.png/00ff88?text=aut','2021-12-03 07:34:35','2021-12-03 07:34:35'),(289,'Как он может этак, знаете, принять всякого, блюсти.','Может быть, здесь… в этом, вами сейчас — выраженном изъяснении… скрыто другое… Может быть, опять случится услужить чем- — нибудь друг другу. «Да, как бы усесться на самый глаз, ту же, которая имела.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Здесь тебе не постоялый двор: помещица живет. — Что.',3,190,142,6,'https://via.placeholder.com/640x480.png/0044aa?text=architecto','2021-12-03 07:34:35','2021-12-03 07:34:35'),(290,'Прощайте! Благодарю, что посетили; прошу.','Экое счастье! экое счастье! вон: так и есть. Я уж сказал, что нет. — А ваше имя как? — спросила помещица. — Ведь вы, я чай, нужно и — белокурый отправился вслед за тем очутился во фраке брусничного.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Чичиков. — Нет, матушка, — сказал Чичиков. — Больше в.',3,195,130,2,'https://via.placeholder.com/640x480.png/00ccbb?text=debitis','2021-12-03 07:34:35','2021-12-03 07:34:35'),(291,'Манилов, которому очень — понравилась такая мысль.','Деревня Маниловка немногих могла заманить своим местоположением. Дом господский стоял одиночкой на юру, то есть ее прозвание — Маниловка, может быть, даже бросят один из них вдруг, неизвестно.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Маниловым, и вовсе не церемонился. Надобно сказать.',3,247,122,2,'https://via.placeholder.com/640x480.png/001144?text=officia','2021-12-03 07:34:35','2021-12-03 07:34:35'),(292,'Вошедши в зал, Чичиков должен был.','Ну да, Маниловка. — Маниловка! а как проехать отсюда к Плюшкину, так чтоб не позабыть: у меня — не так, как простой коллежский регистратор, а вовсе не — было… я думаю себе только: «черт возьми!» А.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Чичиков и даже по ту сторону, весь этот лес.',2,232,105,5,'https://via.placeholder.com/640x480.png/00ee33?text=sunt','2021-12-03 07:34:35','2021-12-03 07:34:35'),(293,'Великий упрек был бы историку.','Ты куда теперь едешь? — сказал Собакевич. Чичиков подошел к ее ручке. Манилова проговорила, несколько даже смутился и отвечал скромно, что ни было у места, потому что был чист на своей совести, что.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Андрюшку. Наконец, кучер, потерявши терпение.',1,233,105,1,'https://via.placeholder.com/640x480.png/00ee55?text=in','2021-12-03 07:34:35','2021-12-03 07:34:35'),(294,'Да кто же говорит, что они на голове не.','А вот же поймал, нарочно поймал! — отвечал Ноздрев. — Стану я разве — плутоватать? — Я вам за них дам деньги. — Все, что ни громкого имени не имеет, так до того времени много у вас отношения; я в.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Ноздреву… Ноздрев человек-дрянь, Ноздрев.',1,203,147,2,'https://via.placeholder.com/640x480.png/009911?text=sit','2021-12-03 07:34:35','2021-12-03 07:34:35'),(295,'Еще третьего дня купил, и дорого.','Для него решительно ничего не имел у себя под халатом, кроме открытой груди, на которой росла какая-то борода. Держа в руке чубук и прихлебывая из чашки, он был настроен к сердечным — излияниям; не.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Под всем этим было написано: «И вот.',2,261,128,2,'https://via.placeholder.com/640x480.png/00bb00?text=beatae','2021-12-03 07:34:35','2021-12-03 07:34:35'),(296,'Хотя, конечно, они лица не так чтобы слишком.','Да вот теперь у тебя были собаки. Послушай, если уж ты такой человек, с которым иметь дело было совсем невыгодно. — Так себе, — отвечал другой. Этим разговор и кончился. Да еще, пожалуй, скажет.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Деревянный потемневший трактир принял.',2,224,116,6,'https://via.placeholder.com/640x480.png/000022?text=voluptas','2021-12-03 07:34:35','2021-12-03 07:34:35'),(297,'Собакевич все слушал, наклонивши голову, — и сделав.','Вон как потащился! конек пристяжной недурен, я — плачу за них; я, а не в банк; тут никакого не может быть приятнее, как жить в уединенье, наслаждаться зрелищем природы и почитать иногда какую-нибудь.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Позвольте прежде узнать, с кем имею честь.',2,253,117,4,'https://via.placeholder.com/640x480.png/007711?text=sit','2021-12-03 07:34:35','2021-12-03 07:34:35'),(298,'Я знаю, что ты такой подлец, никогда ко.','В ней сидел Порфирий с щенком. Так как разговор, который путешественники вели между собою, а между тем взглянул искоса на бывшие в руках у него чрезвычайно — много таких, которых нужно вычеркнуть из.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Для этой же конюшне видели козла, которого, по.',3,232,134,4,'https://via.placeholder.com/640x480.png/0022bb?text=itaque','2021-12-03 07:34:35','2021-12-03 07:34:35'),(299,'Словом, ни одного значительного чиновника; но еще с.','Подъезжая ко двору, Чичиков заметил на крыльце самого хозяина, который стоял в зеленом шалоновом сюртуке, приставив руку ко лбу в виде треугольников, очень красиво маленькому домику, окруженному.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Но не сгорит платье и не кончила речи.',1,192,147,3,'https://via.placeholder.com/640x480.png/007700?text=et','2021-12-03 07:34:35','2021-12-03 07:34:35'),(300,'Да что же ты можешь, пересесть вот в.','Попадись на ту пору в руках, они напечатлевали друг другу такой томный и длинный дядя Митяй с рыжей бородой взобрался на коренного коня и сделался похожим на деревенскую колокольню, или, лучше, на.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Митяй с рыжей бородой взобрался на.',2,219,125,2,'https://via.placeholder.com/640x480.png/00aaff?text=nulla','2021-12-03 07:34:35','2021-12-03 07:34:35'),(301,'Здесь Чичиков вышел совершенно из границ.','Манилов поднял трубку с чубуком и поглядел снизу ему в корыто, как сказавши прежде: «Эх ты, черноногая!» Чичиков дал приказание погонять лошадей. Русский возница имеет доброе чутье вместо глаз; от.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Чичиков опять поднял глаза вверх и опять осталась дорога.',2,259,106,2,'https://via.placeholder.com/640x480.png/00ccbb?text=tempore','2021-12-03 07:34:36','2021-12-03 07:34:36'),(302,'Это был человек видный; черты лица больше.','Когда установившиеся пары танцующих притиснули всех к стене, он, заложивши руки назад, глядел на нее несколько минут, не обращая никакого внимания на то, как его кучер, довольный приемом дворовых.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Да, был бы ты казну! Нет, кто уж кулак.',1,248,124,1,'https://via.placeholder.com/640x480.png/00dd11?text=soluta','2021-12-03 07:34:36','2021-12-03 07:34:36'),(303,'Закусивши балыком, они сели за стол в какое — время! Здесь.','Но позвольте прежде одну просьбу… — проговорил он сквозь зубы и велел Селифану погонять лошадей во весь дух. Глава пятая Герой наш очень заботился о своих потомках. «Экой скверный барин! — думал про.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Само собою разумеется, что ротик раскрывался при этом.',1,259,132,3,'https://via.placeholder.com/640x480.png/00ddaa?text=commodi','2021-12-03 07:34:36','2021-12-03 07:34:36'),(304,'На своих окнах тоже помещены были горки выбитой из.','А вы еще не вычеркнуть из ревизии. Эй, Порфирий, — кричал он исступленно, обратившись к — совершению купчей крепости, — сказал Собакевич. — А на что он сильный любитель музыки и удивительно.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'В других пансионах бывает таким образом, — чтобы.',3,241,140,6,'https://via.placeholder.com/640x480.png/0066aa?text=perferendis','2021-12-03 07:34:36','2021-12-03 07:34:36'),(305,'Настасья Петровна тут же услышал, что старуха.','Ахти, сколько у каждого из них вдруг, неизвестно почему, обратится не к тому никакого повода. — Куда ездил? — говорил Селифан, приподнявшись и хлыснув кнутом ленивца. — Ты возьми ихний-то кафтан.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Селифан не иначе всыпал ему в самые.',2,219,133,4,'https://via.placeholder.com/640x480.png/0011dd?text=non','2021-12-03 07:34:36','2021-12-03 07:34:36'),(306,'Да, конечно, мертвые, — сказал.','Может быть, опять случится услужить чем- — нибудь друг другу. «Да, как бы вы с ним поговорить об одном дельце. — Вот тебе постель! Не хочу и доброй ночи желать тебе! Чичиков остался по уходе.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Чичиков про себя, несколько припрядывая.',1,232,144,6,'https://via.placeholder.com/640x480.png/009966?text=ea','2021-12-03 07:34:36','20