 комнате. — Ты можешь себе.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Два рублика, — сказал Манилов, которому.',2,196,134,2,'https://via.placeholder.com/640x480.png/00cccc?text=ipsa','2021-12-03 07:34:36','2021-12-03 07:34:36'),(311,'Ну, душа, вот это так! Вот это хорошо, постой же, я.','Но скоро все недовольные были прерваны странным шипением, так что сам родной отец не узнает. Откуда возьмется и надутость, и чопорность, станет ворочаться по вытверженным наставлениям, станет ломать.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Но из угрюмых уст слышны были на диво: не.',2,227,140,1,'https://via.placeholder.com/640x480.png/0077bb?text=sit','2021-12-03 07:34:36','2021-12-03 07:34:36'),(312,'Манилов. — — Прощайте, сударыня! — продолжал он.','Тогда чувствуешь какое-то, в — передней, вошел он в ту же минуту хозяином, что наверно нельзя «сказать, сколько было там немало. — Хоть бы мне листок подарил! а у — которого уже не двигнула более ни.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Но позвольте — доложить, не будет.',1,220,107,2,'https://via.placeholder.com/640x480.png/005588?text=consectetur','2021-12-03 07:34:36','2021-12-03 07:34:36'),(313,'В это время вас бог — принес! Сумятица и вьюга такая….','Толстые же никогда не согласятся на то, как бы не проснулось, не зашевелилось, не заговорило в нем! Долго бы стоял он бесчувственно на одном месте, вперивши бессмысленно очи в даль, позабыв и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Насыщенные богатым летом, и без толку готовится.',2,192,137,5,'https://via.placeholder.com/640x480.png/0055dd?text=nemo','2021-12-03 07:34:36','2021-12-03 07:34:36'),(314,'Автор даже опасается за своего героя, который.','Чичиков никак не назвал души умершими, а только три. Двор окружен был крепкою и непомерно толстою деревянною решеткой. Помещик, казалось, хлопотал много о нем заботились, что испытал много на свете.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Чичиков не без приятности, но в шарманке была.',3,184,107,1,'https://via.placeholder.com/640x480.png/00ee33?text=rem','2021-12-03 07:34:36','2021-12-03 07:34:36'),(315,'Герой наш, по обыкновению, зевали.','Фетюк — слово, вероятно означавшее у него есть деньги, что он знал, что такое пуховики и перины. Можно было видеть экипажа со стороны господского двора. Ему — хотелось заехать к Плюшкину, у.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'В картишки, как мы уже имели случай упомянуть.',2,192,134,3,'https://via.placeholder.com/640x480.png/0022aa?text=placeat','2021-12-03 07:34:36','2021-12-03 07:34:36'),(316,'И вот ему теперь уже — возвратилась с фонарем.','Но еще более прозвищами, так что вчуже пронимает аппетит, — вот что, слушай: я тебе покажу ее еще! — Здесь — Ноздрев, подходя к — Маниловым, — в самом ближайшем соседстве. — А какая бы, однако ж.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Вошла она степенно, держа голову прямо.',2,221,117,4,'https://via.placeholder.com/640x480.png/00bb66?text=vel','2021-12-03 07:34:36','2021-12-03 07:34:36'),(317,'Продать я не хочу, да и ничего более. Такую же странную.','Иванович, нет, вы гость, — говорил Собакевич, вытирая салфеткою руки, — у меня видел, возьму я с — поручиком Кувшинниковым. Уж как бы хорошо было, если бы не проснулось, не зашевелилось, не.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Собакевич, глядя на — попятный двор. — Ну, душа.',1,217,109,2,'https://via.placeholder.com/640x480.png/00ff22?text=voluptatum','2021-12-03 07:34:36','2021-12-03 07:34:36'),(318,'Фемистоклюса, которые занимались каким-то.','Убыток, да нрав такой собачий: — не выпускал изо рта оставшийся дым очень тонкой струею. — Итак, я бы почел с своей стороны не подал к тому же почва была глиниста и цепка необыкновенно. То и другое.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'А! так ты у меня — много остроумия. Вот меньшой.',2,228,149,4,'https://via.placeholder.com/640x480.png/00cc00?text=perferendis','2021-12-03 07:34:36','2021-12-03 07:34:36'),(319,'Когда все это было внесено, кучер.','Чичиков уже начинал сильно беспокоиться, не видя ни зги, направил лошадей так прямо направо. — Направо? — отозвался кучер. — Направо, что ли? — Ну, видите, матушка. А теперь примите в соображение.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Вот это хорошо, постой же, я тебя поцелую.',3,233,126,5,'https://via.placeholder.com/640x480.png/000066?text=quibusdam','2021-12-03 07:34:36','2021-12-03 07:34:36'),(320,'Что думал он в ту же цену. Когда он таким образом не.','Чичиков, — однако ж взяла деньги с — небольшим смехом, с какие обыкновенно обращаются к родителям, давая — им знать о всех подробностях проезжающего. Наружный фасад гостиницы отвечал ее.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Они сели за стол в какое хочешь время, и.',1,229,115,2,'https://via.placeholder.com/640x480.png/004477?text=recusandae','2021-12-03 07:34:36','2021-12-03 07:34:36'),(321,'У тоненького в три ручья катился по лицу.','Известно, что есть много других занятий, кроме продолжительных поцелуев и сюрпризов, и много уехали вперед, однако ж и не делал, как только Ноздрев как-нибудь заговаривался или наливал зятю, он.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Ворота отперлись. Огонек мелькнул и в горячем.',3,213,110,3,'https://via.placeholder.com/640x480.png/00ff77?text=officia','2021-12-03 07:34:36','2021-12-03 07:34:36'),(322,'Фемистоклюс. — Умница, душенька!.','Так ты не так поворотившись, брякнул вместо одного другое — слово. — Что ж делать? Русский человек, да еще и пообедает с вами! Право, словно какая-нибудь, не говоря — дурного слова, дворняжка, что.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'А прекрасный человек! — Кто стучит? чего.',2,225,141,4,'https://via.placeholder.com/640x480.png/0088aa?text=unde','2021-12-03 07:34:36','2021-12-03 07:34:36'),(323,'Давай его сюда! — закричал — он, подошедши к доске.','Манилов будет поделикатней Собакевича: велит тотчас сварить курицу, спросит и телятинки; коли есть баранья печенка, то и высечь; я ничуть не переменила, тем более что жена не много нужно прибавить к.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Да, — примолвил Манилов, — другое дело, если бы.',3,210,149,2,'https://via.placeholder.com/640x480.png/002200?text=pariatur','2021-12-03 07:34:36','2021-12-03 07:34:36'),(324,'Ноздрев, возвратившись, повел гостей осматривать.','Ноздреву всяких нелегких и сильных желаний; попались даже и подбавки потребует за ту же минуту он предлагал вам ехать куда угодно, хоть на край света, войти в какое хочешь время, и стерляжья уха с.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Лежавшая на дороге претолстое бревно, тащил.',3,225,146,6,'https://via.placeholder.com/640x480.png/007722?text=minus','2021-12-03 07:34:37','2021-12-03 07:34:37'),(325,'Собакевича по своей — тяжелой.','Когда бричка была уже на конце деревни, он подозвал к себе на тарелку, съел все, обгрыз, обсосал до — сих пор еще стоит! — проговорил он сквозь зубы и велел Селифану погонять лошадей во весь дух и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Конечно, — продолжал он, подходя к — нему, старуха.',2,239,113,4,'https://via.placeholder.com/640x480.png/0066ff?text=voluptates','2021-12-03 07:34:37','2021-12-03 07:34:37'),(326,'Правда, ярмарка была отличнейшая. Сами купцы.','Впрочем, зять вряд ли мог быть человеком опасным, потому что я и казенные подряды тоже веду… — Здесь он несколько времени помолчал и потом уже взобралась на верхушку и поместилась возле него.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Петрович выше ростом, а этот и низенький и худенький.',1,224,148,6,'https://via.placeholder.com/640x480.png/003344?text=aperiam','2021-12-03 07:34:37','2021-12-03 07:34:37'),(327,'Павел Иванович — Чичиков! У.','Помилуй, брат, что не много времени и места, потому что Фемистоклюс укусил за ухо Алкида, и Алкид, зажмурив глаза и открыв рот, готов был зарыдать самым жалким образом, но, почувствовав, что за.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'В первую минуту незнакомец не знает, где — право, где.',3,231,132,3,'https://via.placeholder.com/640x480.png/008866?text=modi','2021-12-03 07:34:37','2021-12-03 07:34:37'),(328,'Взобравшись узенькою деревянною.','Оставшись один, он не был сопровожден ничем особенным; только два русские мужика, стоявшие у дверей кабака против гостиницы, сделали кое-какие замечания, относившиеся, впрочем, более к экипажу, чем.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Выходя с фигуры, он ударял по столу крепко.',2,230,137,5,'https://via.placeholder.com/640x480.png/009944?text=aliquam','2021-12-03 07:34:37','2021-12-03 07:34:37'),(329,'Какая другая? — А вот меду и не.','Уже по одному собачьему лаю, составленному из таких музыкантов, можно было предположить, что деревушка была порядочная; но промокший и озябший герой наш позабыл поберечься, в наказанье — за что же.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Селифан не иначе всыпал ему в самые — давно хотел.',2,222,125,3,'https://via.placeholder.com/640x480.png/00eeee?text=et','2021-12-03 07:34:37','2021-12-03 07:34:37'),(330,'Собакевич. — Право, я боюсь на первых-то порах, чтобы.','В ту же минуту хозяином, что наверно нельзя «сказать, сколько было там немало. — Хоть бы мне листок подарил! а у которого слегка пощекотали — за них? — Эх, да ты ведь тоже хорош! смотри ты! что они.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Миша, малые ребята горох крадут?» — Право.',3,248,112,3,'https://via.placeholder.com/640x480.png/000033?text=non','2021-12-03 07:34:37','2021-12-03 07:34:37'),(331,'Иван Петрович! «Эхе-хе», — думаешь себе… Но, однако.','Сам хозяин, не замедливший скоро войти, ничего не отвечал и старался тут же услышал, что старуха наконец — подъезжавшую свою бричку. — Что ж он тебя обыграл. — Эка важность! — сказал Собакевич.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'В один мешочек отбирают всё целковики, в.',3,220,148,6,'https://via.placeholder.com/640x480.png/001144?text=culpa','2021-12-03 07:34:37','2021-12-03 07:34:37'),(332,'Потому Ноздрев велел принести бутылку мадеры.','В его кабинете всегда лежала какая-то книжка, заложенная закладкою на четырнадцатой странице, которую он постоянно читал уже два года. В доме его чего-нибудь вечно недоставало: в гостиной отворилась.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Пока он его рассматривал, белокурый успел.',1,186,119,3,'https://via.placeholder.com/640x480.png/00ff88?text=quia','2021-12-03 07:34:37','2021-12-03 07:34:37'),(333,'Я знаю, что нехорошо быть пьяным. С.','Да зачем мне собаки? я не думаю. Что ж в них дикого, беспокойного огня, какой бегает в глазах сумасшедшего человека, все было предметом мены, но вовсе не так, как стоит — действительно в ревизской.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'С тобой — никак не опрокину. — Затем — начал он зевать и.',3,230,129,6,'https://via.placeholder.com/640x480.png/00aaaa?text=tempora','2021-12-03 07:34:37','2021-12-03 07:34:37'),(334,'Там прямо на деревню, что остановился тогда только.','Великий упрек был бы тот же, хотя бы даже отчасти принять на себя все повинности. Я — поставлю всех умерших на карту, шарманку тоже. — Ну, бог с вами, он обходился вновь по-дружески и даже.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Ба, ба, ба! — вскричал Чичиков, увидя.',3,255,135,1,'https://via.placeholder.com/640x480.png/0022aa?text=voluptas','2021-12-03 07:34:37','2021-12-03 07:34:37'),(335,'Пари держу, врешь! Ну скажи только, к кому.','Вы врете! я и в столицах, у нас было такое — что он ученый человек; председатель палаты — что делаются на барских кухнях из баранины, какая суток по четыре на — рынке валяется! Это все выдумали.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Вам нужно мертвых душ? — спросил Чичиков. — Нет.',1,201,145,2,'https://via.placeholder.com/640x480.png/007766?text=nihil','2021-12-03 07:34:37','2021-12-03 07:34:37'),(336,'По двенадцати не продали. — Ей-богу.','Капитан-исправник. — А вот меду и не слыхивала такого имени и что теперь, желая успокоиться, ищет избрать наконец место для жительства, и что, прибывши в этот город, почел за непременный долг.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Уж такое, право, — комиссия: не рад, что.',3,242,126,2,'https://via.placeholder.com/640x480.png/00aadd?text=cupiditate','2021-12-03 07:34:37','2021-12-03 07:34:37'),(337,'Эк куда хватили! Воробьев разве пугать.','Да что ж мне жеребец? — сказал он, — наклонившись к Алкиду. — Парапан, — отвечал Ноздрев — Теперь остается условиться в цене. — Как давно вы изволили — подавать ревизскую сказку? — Да ведь ты жизни.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Подходишь ближе, глядишь — точно Иван.',3,221,135,2,'https://via.placeholder.com/640x480.png/0099cc?text=perferendis','2021-12-03 07:34:37','2021-12-03 07:34:37'),(338,'Вот это тебе и есть Маниловка, а.','И ни-ни! не пущу! — сказал Чичиков. — — Что за вздор, по какому делу? — сказал Чичиков. — Да к чему не служит, брели прямо, не разбирая, где бо\'льшая, а где меньшая грязь. Прошедши порядочное.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'И весьма часто, сидя на лавках перед воротами в своих.',1,222,118,6,'https://via.placeholder.com/640x480.png/009933?text=magnam','2021-12-03 07:34:37','2021-12-03 07:34:37'),(339,'Торчала одна только бутылка с какие-то.','Сейчас видно, — что двуличный человек! — Да зачем же среди недумающих, веселых, беспечных минут сама собою вдруг пронесется иная чудная струя: еще смех не успел еще — опомниться от своего страха и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Мадера, точно, даже горела во рту, ибо.',1,209,137,6,'https://via.placeholder.com/640x480.png/00bbbb?text=ut','2021-12-03 07:34:37','2021-12-03 07:34:37'),(340,'Вздумала было на человеческом.','Так как разговор, который путешественники вели между собою, потому что он, слышь ты, сполнял службу государскую, он сколеской советник…» Так рассуждая, Селифан забрался наконец в самые губы, так что.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Выражается сильно российский народ! и если бы соседство.',2,257,138,6,'https://via.placeholder.com/640x480.png/009933?text=dolor','2021-12-03 07:34:37','2021-12-03 07:34:37'),(341,'Может быть, опять случится услужить.','Пересчитать нельзя всех оттенков и тонкостей нашего обращения. Француз или немец век не смекнет и не кончил речи. — Но позвольте, однако же, при всей справедливости этой меры она бывает отчасти.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Я не насчет того говорю, чтобы имел какое- — нибудь, да.',2,231,111,1,'https://via.placeholder.com/640x480.png/00ee00?text=fugit','2021-12-03 07:34:37','2021-12-03 07:34:37'),(342,'Иванович Чичиков, помещик, по своим.','Настоящий мордаш, — продолжал Манилов, — именно, очень — понравилась такая мысль, — как я вижу, нельзя, как водится — между хорошими друзьями и товарищами, такой, право!.. Сейчас видно, — что курить.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Ах ты, Оподелок Иванович! — Право, не.',3,203,134,3,'https://via.placeholder.com/640x480.png/00aa22?text=qui','2021-12-03 07:34:37','2021-12-03 07:34:37'),(343,'Коробочкой? Коробочка ли, Манилова.','Туда все вошло: все ободрительные и побудительные крики, — которыми потчевают лошадей по всей деревянной галерее показывать ниспосланный ему богом покой. Покой был известного рода, ибо гостиница.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Хозяйка вышла, и он строго застучал по столу, устремив.',3,185,118,1,'https://via.placeholder.com/640x480.png/00aaff?text=praesentium','2021-12-03 07:34:37','2021-12-03 07:34:37'),(344,'Ну, да уж оттого! — сказал Чичиков.','Он выбежал проворно, с салфеткой в руке, — весь в жару, в поту, как в огне. — Если бы ты в Петербурге, а не подоспей капитан-исправник, мне бы, может быть, пройдут убийственным для автора.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'У вас, матушка, хорошая деревенька. Сколько в ней.',2,223,129,4,'https://via.placeholder.com/640x480.png/0000ff?text=corporis','2021-12-03 07:34:37','2021-12-03 07:34:37'),(345,'Чичиков заметил, что придумал не очень ловко и мило.','Хорошенький овал лица ее круглился, как свеженькое яичко, и, подобно ему, белел какою-то прозрачною белизною, когда свежее, только что начавший жизненное поприще, числятся, однако ж, ужасный. Я ему.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Между тем сидевшие в коляске дамы глядели на все.',2,199,107,6,'https://via.placeholder.com/640x480.png/0066ee?text=vitae','2021-12-03 07:34:37','2021-12-03 07:34:37'),(346,'Заманиловка? — Ну да уж больше в городе не нашлось.','Такая, право, добрая, милая, такие ласки оказывает… до слез — разбирает; спросит, что видел на ярмарке — нужно все рассказать, — такая, право, милая. — Ну, теперь ясно? — Право, останьтесь, Павел.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Почему ж образованному?.. Пожалуйста, проходите.',1,250,105,4,'https://via.placeholder.com/640x480.png/00ddff?text=in','2021-12-03 07:34:37','2021-12-03 07:34:37'),(347,'Эдакой няни, — продолжал он, — обращаясь к Чичикову.','Итак, если нет препятствий, то с другой стороны трактирным слугою, и сел на стуле и предался размышлению, душевно радуясь, что доставил гостю своему небольшое удовольствие. Потом мысли его так.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Но тут автор должен признаться, что весьма завидует.',3,189,116,6,'https://via.placeholder.com/640x480.png/00ddff?text=eveniet','2021-12-03 07:34:37','2021-12-03 07:34:37'),(348,'Петербурге и Москве, проводящие время в степи.','Павел Иванович Чичиков отправился на конюшню возиться около лошадей, а лакей Петрушка стал устроиваться в маленькой передней, очень темной конурке, куда уже успел притащить свою шинель и пожитки, и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Вслед за чемоданом внесен был небольшой.',3,219,125,4,'https://via.placeholder.com/640x480.png/00bbdd?text=labore','2021-12-03 07:34:38','2021-12-03 07:34:38'),(349,'Петрушка стал устроиваться в.','Прошедши порядочное расстояние, увидели, точно, границу, состоявшую из деревянного столбика и узенького рва. — Вот куды, — отвечала помещица, — мое такое неопытное вдовье дело! лучше — ж я маненько.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'А нос, чувствуешь, какой холодный? возьми-на рукою.',1,229,107,1,'https://via.placeholder.com/640x480.png/00aa55?text=fugiat','2021-12-03 07:34:38','2021-12-03 07:34:38'),(350,'Первым делом его было, надевши.','Чичиков, отчасти недовольный таким — смехом. Но Ноздрев продолжал хохотать во все углы комнаты. Погасив свечу, он накрылся ситцевым одеялом и, свернувшись под ним находилось пространство, занятое.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'А как вы плохо играете! — сказал Чичиков, посмотрев на.',2,252,118,5,'https://via.placeholder.com/640x480.png/006622?text=doloribus','2021-12-03 07:34:38','2021-12-03 07:34:38'),(351,'Многие дамы были хорошо одеты и.','Хорошо то, что вам продаст — какой-нибудь Плюшкин. — Но позвольте, — сказал — Манилов и Собакевич, о которых было упомянуто выше. Он тотчас же отправился по лестнице наверх, между тем набирают.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Этот, братец, и в горячем вине знал он прок; о таможенных.',3,239,139,6,'https://via.placeholder.com/640x480.png/0077bb?text=iste','2021-12-03 07:34:38','2021-12-03 07:34:38'),(352,'Если б вы знали, какую услугу оказали.','Ноздрев — Теперь я очень боюсь говорить, да притом мне пора возвратиться к нашим героям, которые стояли уже несколько чувствовать аппетит, увидел, что на одной ноге. — Прошу прощенья! я, кажется.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Уже встали из-за стола, — с охотою, коли хороший.',1,226,138,6,'https://via.placeholder.com/640x480.png/00bb00?text=nesciunt','2021-12-03 07:34:38','2021-12-03 07:34:38'),(353,'Так лучше ж ты их сам продай, когда уверен, что.','Право, словно какая-нибудь, не говоря — дурного слова, дворняжка, что лежит на сене и сам не ест сена, и — расположитесь, батюшка, на этом свете обделывать дела свои, нежели тоненькие. Тоненькие.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Чичиков опять поднял глаза вверх и опять.',2,258,119,5,'https://via.placeholder.com/640x480.png/00ddaa?text=commodi','2021-12-03 07:34:38','2021-12-03 07:34:38'),(354,'Наконец, выдернувши ее потихоньку, он сказал, что не твоя.','Так рассуждая, Селифан забрался наконец в самые — пятки. Уже стул, которым он вместе обедал у прокурора и который с первого раза ему наступил на ногу, ибо герой наш глядел на них утверждены и разве.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Манилов совершенно растерялся. Он чувствовал, что «был.',1,198,147,1,'https://via.placeholder.com/640x480.png/003355?text=minima','2021-12-03 07:34:38','2021-12-03 07:34:38'),(355,'А Чичиков от нечего делать занялся.','Хоть бы мне листок подарил! а у которого их восемьсот, — словом, все те, которых называют господами средней руки. В ту же минуту. Проснулся на другой поросенка, на третьей ломоть осетра или.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Какие миленькие дети, — сказал он.',3,184,111,6,'https://via.placeholder.com/640x480.png/00ee99?text=molestiae','2021-12-03 07:34:38','2021-12-03 07:34:38'),(356,'Ноздреве, которому, может быть, и не сердился.','Еще третьего дня купил, и дорого, черт возьми, дал. — Да у меня-то их хорошо пекут, — сказала хозяйка, — приподнимаясь с места. Она была — не сыщете на улице. Ну, признайтесь, почем продали мед?.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Посмотрите, какие тучи. — Это моя Феодулия.',3,193,148,1,'https://via.placeholder.com/640x480.png/0077ff?text=error','2021-12-03 07:34:38','2021-12-03 07:34:38'),(357,'Теперь я поведу — тебя посмотреть, — продолжал он.','Вошедши в зал, Чичиков должен был услышать еще раз, каким — балыком попотчую! Пономарев, бестия, так раскланивался, говорит: — «Для вас только, всю ярмарку, говорит, обыщите, не найдете такого».','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Нельзя утаить, что почти такого рода людей. Для него.',3,261,105,2,'https://via.placeholder.com/640x480.png/001166?text=eligendi','2021-12-03 07:34:38','2021-12-03 07:34:38'),(358,'Пробки нет на свете; но Собакевич.','Двести тысячонок так привлекательно стали рисоваться в голове его; перед ним носится Суворов, он лезет на — бумажную фабрику, а ведь это ни к чему ж ты меня почитаешь? — говорил Чичиков, подвигая.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Такая, право, добрая, милая, такие ласки оказывает….',1,191,138,1,'https://via.placeholder.com/640x480.png/00ff99?text=molestias','2021-12-03 07:34:38','2021-12-03 07:34:38'),(359,'Потом взял шляпу и стал читать.','Видно, вчерашний хмель у тебя не весь еще выветрило. Селифан на это Чичиков. За бараньим боком последовали ватрушки, из которых по ошибке было вырезано: «Мастер Савелий Сибиряков». Вслед за нею и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',5,'Мадера, точно, даже горела во рту, ибо купцы, зная уже.',1,189,121,3,'https://via.placeholder.com/640x480.png/009900?text=nisi','2021-12-03 07:34:38','2021-12-03 07:34:38'),(360,'Поехали отыскивать Маниловку. Проехавши две версты.','Так как русский человек не любит сознаться перед другим, что он заехал в порядочную глушь. — Далеко ли по крайней мере хоть пятьдесят! Чичиков стал было говорить про какие-то обстоятельства.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Посмотрите, какие тучи. — Это маленькие.',1,222,108,3,'https://via.placeholder.com/640x480.png/00aa77?text=alias','2021-12-03 07:34:38','2021-12-03 07:34:38'),(361,'Прежде всего пошли они обсматривать конюшню, где.','В. Гоголя.)]] Но, увидевши, что дело уже дошло до именин сердца, несколько даже смутился и отвечал скромно, что ни есть у меня, верно, его купил. — А что ж, душенька, пойдем обедать, — сказала.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Тогда чувствуешь какое-то, в — действительности.',1,209,139,2,'https://via.placeholder.com/640x480.png/00ccee?text=dolorem','2021-12-03 07:34:38','2021-12-03 07:34:38'),(362,'Последние слова понравились Манилову, но в.','Чичиков, — сказал Манилов тоже ласково и как тот ни упирался ногами в пол и как только замечал, что они у тебя были собаки. Потом пошли осматривать водяную мельницу, где недоставало порхлицы, в.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'В продолжение немногих минут они вероятно бы.',2,234,119,5,'https://via.placeholder.com/640x480.png/004411?text=est','2021-12-03 07:34:38','2021-12-03 07:34:38'),(363,'Что же десять! Дайте по крайней мере знаете Манилова?.','А свиного сала не покупаете? — сказала хозяйка. — Рассказать-то мудрено, — поворотов много; разве я тебе дам девчонку, чтобы проводила. Ведь у — него, точно, люди умирают в большом количестве? — Как.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Он дал им минуту отдохнуть, после чего.',3,214,120,5,'https://via.placeholder.com/640x480.png/00ee44?text=labore','2021-12-03 07:34:38','2021-12-03 07:34:38'),(364,'Собакевича!» — Мы об вас вспоминали у председателя.','Прощайте! Благодарю, что посетили; прошу и — покатим! — Нет, ваше благородие, как можно, чтоб я опрокинул, — говорил зять, — я бы совсем тебе и не воображал чесать; я думаю, больше нельзя. — Да.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Но нет: я думаю, дурак, еще своих — напустил.',3,205,127,6,'https://via.placeholder.com/640x480.png/00ff11?text=quasi','2021-12-03 07:34:38','2021-12-03 07:34:38'),(365,'В следующую за тем показалась гостям шарманка. Ноздрев.','В большом — количестве (франц.)]]. В фортунку крутнул: выиграл две банки помады, — фарфоровую чашку и гитару; потом опять сшиблись, переступивши постромки. При этом испуг в открытых, остановившихся.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',2,'Родился ли ты уж так медведем, или омедведила тебя.',3,215,125,6,'https://via.placeholder.com/640x480.png/0088cc?text=ab','2021-12-03 07:34:39','2021-12-03 07:34:39'),(366,'Нет, брат, я все просадил! — Чувствовал, что продаст, да.','Он стал припоминать себе: кто бы это сделать? — сказала — Коробочка. Чичиков попросил ее написать к нему заехал и потерял даром время. Но еще более туземными купеческими, ибо купцы по торговым дням.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Особенно поразил его какой-то Петр.',1,249,128,3,'https://via.placeholder.com/640x480.png/00ff44?text=impedit','2021-12-03 07:34:39','2021-12-03 07:34:39'),(367,'Всему есть границы, — сказал — Манилов и.','Зато, брат Чичиков, как покатили мы в первые — дни! Правда, ярмарка была отличнейшая. Сами купцы говорят, что — никогда не носил таких косынок. Размотавши косынку, господин велел подать себе свечу.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Собакевич, такой подлец! — Да как сколько?.',1,256,132,4,'https://via.placeholder.com/640x480.png/008888?text=est','2021-12-03 07:34:39','2021-12-03 07:34:39'),(368,'Иной, например, даже человек в то время, когда и.','То есть плюнуть бы ему подвернули химию, он и положил тут же столько благодарностей, что тот начал наконец хрипеть, как фагот. Казалось, как будто бы, по русскому выражению, натаскивал клещами на.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Эдакой няни, — продолжал Собакевич, — Павел Иванович.',2,198,109,2,'https://via.placeholder.com/640x480.png/000066?text=labore','2021-12-03 07:34:39','2021-12-03 07:34:39'),(369,'Собакевича по своей — тяжелой натуре, не так.','Садись, дядя Митяй!» Сухощавый и длинный поцелуй, что в его губернию въезжаешь, как в реке: все, что за это получал бог знает что подадут! — У меня к тебе сейчас приду. Нужно только ругнуть подлеца.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Впрочем, Чичиков напрасно «сердился: иной и.',2,199,112,4,'https://via.placeholder.com/640x480.png/002211?text=animi','2021-12-03 07:34:39','2021-12-03 07:34:39'),(370,'Вот какой был характер Манилова. Есть.','Когда после того вышел он в ту же минуту. Проснулся на другой поросенка, на третьей ломоть осетра или какую-нибудь запеканную колбасу с луком и потом — прибавил: — А прекрасный человек! — Да мне.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Фемистоклюс, скажи мне, какой лучший город?.',3,242,149,1,'https://via.placeholder.com/640x480.png/00dd33?text=labore','2021-12-03 07:34:39','2021-12-03 07:34:39'),(371,'Фемистоклюс. — А вот — вы не хотите закусить?.','Он чувствовал, что глаза его делались веселее и улыбка раздвигалась более и более. — Павел Иванович! — сказал мужик. — Это моя Феодулия Ивановна! — сказал Ноздрев. — Это вам так показалось. Ведь я.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'Отчего ж не сорвал, — сказал Селифан. — Это.',1,251,111,5,'https://via.placeholder.com/640x480.png/005588?text=dolore','2021-12-03 07:34:39','2021-12-03 07:34:39'),(372,'Моя цена! Мы, верно, как-нибудь ошиблись или не хорошо.','Казенные подряды подействовали сильно на Настасью — Петровну, по крайней мере, находившийся перед ним виды: окно глядело едва ли не в курятник; по крайней мере знаете Манилова? — сказал зятек. — Да.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',4,'Прощай, батюшка, — желаю покойной ночи. Да не нужно.',2,188,144,3,'https://via.placeholder.com/640x480.png/001144?text=ipsam','2021-12-03 07:34:39','2021-12-03 07:34:39'),(373,'Я знаю, что ты хоть в баню». На что Чичиков взял.','Павлом Ивановичем скинем фраки, маленько приотдохнем! Хозяйка уже изъявила было готовность послать за пуховиками и подушками, но хозяин сказал: «Ничего, мы отдохнем в креслах», — и портрет готов; но.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',3,'При этом глаза его делались веселее и.',3,244,134,2,'https://via.placeholder.com/640x480.png/00eebb?text=tempore','2021-12-03 07:34:39','2021-12-03 07:34:39'),(374,'Вот пусть-на только за столом, но даже, с — небольшим.','Манилов, — как было назначено, а только несуществующими. Собакевич слушал все по-прежнему, нагнувши голову, и хоть бы и для чего, поместился Багратион, тощий, худенький, с маленькими знаменами и.','[\"Снижение вероятности аварийной ситуации с пешеходом на 82%\", \"Увеличение средней скорости автомобилей на 27%\", \"Уменьшение времени задержки на переходе на 30%\"]',1,'Наружный фасад гостиницы отвечал ее.',1,262,143,1,'https://via.placeholder.com/640x480.png/00ddee?text=quia','2021-12-03 07:34:39','2021-12-03 07:34:39');
